import React from 'react';
import {Link} from 'react-router-dom';
const Menu = () => {
    return ( 
        <div className="nav-menu">
                    <ul className="nav-menu-list">
                        <li className="nav-menu-item"><Link to={'./presentacion'} className="nav-link"><i class="uil uil-estate"></i>Home</Link></li>
                        <li className="nav-menu-item"><Link to={'./sobre'} className="nav-link"><i class="uil uil-user"></i>Sobre Mi</Link></li>
                        <li className="nav-menu-item"><a href="#!" className="nav-link"><i class="uil uil-file"></i>Skills</a></li>
                        <li className="nav-menu-item"><a href="#!" className="nav-link"><i class="uil uil-bag-alt"></i>Services</a></li>
                        <li className="nav-menu-item"><a href="#!" className="nav-link"><i class="uil uil-image-v"></i>Portfolio</a></li>
                        <li className="nav-menu-item"><a href="#!" className="nav-link">Contact me</a></li>
                    </ul>
        </div>
    );
}

export default Menu;
